  input: '"TEXT","F3XA","C00364737","This report is being amended to more clearly
    describe the interest received from JPMorgan Chase Bank as interest rather than
    other receipt.    This is also to inform the FEC that all payments referenced
    on schedule B for items such as fundraising consultation and cell phone expenses,
    etc. were in connection with the PACs own fundraising efforts. These expenditures
    do not support any clearly identified candidate, and do not promote, support,
    attack, or oppose any federal candidate. Accordingly, these disbursements do not
    necessitate additional line 23 or line 24 disclosure.     This is also to inform
    the FEC that the consultants that work on fund-raising and accounting for the
    PAC are self-employed individuals that work from their homes. Therefore, the PAC
    does not have administrative expenses such as payroll, rent and utilities."'
